import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { getAllKyc } from '../../../actions/adminActions';
import './AdminKyc.css'

const AdminKyc = () => {
    const dispatch = useDispatch();
    const kyc = useSelector(state => state.allKyc)

    console.log(kyc);

    useEffect(() => {
        dispatch(getAllKyc())
    },[])

  return (
    <div className='kyc' >
        Kyc
        
        <div className="top">
            <button className='bnt' onClick={() => setEd("employee")} >Employees</button>
            <button className='bnt' onClick={() => setEd("employer")}>Employers</button>
            <button className='bnt' onClick={() => setEd("block")}>Blocked Users</button>
        </div>
    </div>
  )
}

export default AdminKyc
